$(document).ready(function(){$('form.vote :radio.star').rating({required:true,callback:function(c,d){$.post($('form.vote')[0].action,{vote:c},function(a,b){if(b!='success'){alert('Your request could not be processed. Please try again later or contact an admin if the problem persists.')}else{if(!a['success']){alert(a['message'])}}},'json')}});$('form.vote :button.submit').css('display','none');$('#username').bind('focus',function(e){if(this.value=='username')this.value=''});$('#password').bind('focus',function(e){if(this.value=='password')this.value=''});$('#username').bind('blur',function(e){if(!this.value)this.value='username'});$('#password').bind('blur',function(e){if(!this.value)this.value='password'});prettyPrint()});